import React from 'react';
import { useNavigate } from 'react-router-dom';
import BottomNav from './BottomNav';

function Transact() {
  const navigate = useNavigate();

  const transactionItems = [
    { icon: 'üë§', name: 'Pay beneficiary', badge: 'New' },
    { icon: '‚ö°', name: 'PayShap', badge: 'New' },
    { icon: 'üìã', name: 'Pay bills', badge: 'New' },
    { icon: 'üåç', name: 'Cross-border money transfers', badge: 'New' },
    { icon: 'üí±', name: 'International payments', badge: 'New' },
    { icon: 'üì±', name: 'Buy airtime and data', badge: 'New' },
    { icon: 'üí°', name: 'Buy electricity and water', badge: 'New' },
    { icon: 'üé≤', name: 'Play LOTTO', badge: 'New' },
    { icon: 'üé´', name: 'Buy vouchers', badge: 'New' },
    { icon: 'üöó', name: 'Renew licence disc', badge: 'New' },
    { icon: 'üí∏', name: 'Transfer money', badge: 'New' }
  ];

  return (
    <div className="transact-page">
      <div className="transact-header">
        <h2>Transact</h2>
        <p>Quick and secure transactions</p>
      </div>

      <div className="transact-grid">
        {transactionItems.map((item, index) => (
          <div key={index} className="transact-item">
            <div className="transact-icon">{item.icon}</div>
            <div className="transact-name">{item.name}</div>
            {item.badge && <span className="transact-badge">{item.badge}</span>}
          </div>
        ))}
      </div>

      <BottomNav active="transact" />
    </div>
  );
}

export default Transact;
